import Button from "../ui/Button";
function Pagination() {
  return (
    <div className="d-flex">
      <small className="text-muted flex-grow-1">Showing 1 to 10 of 96 entries</small>
      <div className="button-group">
        <Button>1</Button>
      </div>
    </div>
  );
}
export default Pagination;
